"description": "*SIZES - inches (custom sizes available)\r\nXSmall - 3&quot; x 1.5&quot;\r\nSmall - 4&quot; x 2&quot;\r\n*Medium - 5&quot; x 2.5&quot; (size in photo)\r\nLarge - 7.5&quot; x 3.75&quot;\r\nXLarge - 10&quot; x 5&quot;\r\n\r\nTRY OUR FAST CUSTOM ORDERS!\r\n\r\nFlour and Sugar container vinyl decal stickers. Comes with 2 stickers total.\r\n\r\nalso pick a custom name (add note at check out for the two you want, if not, flour and sugar will be sent)\r\nsome ideas others have used are:\r\n\r\n- All Purpose Flour\r\n- Self Rising Flour\r\n- Brown Sugar\r\n- Powdered Sugar\r\n- Mint\r\n- Parsley\r\n- Corn Meal\r\n- Cilantro\r\n- Whole Wheat Flour\r\n- Katsup\r\n- Cranberry\r\n- Flax seed\r\n- Cornstarch\r\n- Chia\r\n- Baking Soda\r\n- Baking Powder\r\n- Protein Powder\r\n- Chutney\r\n- Xylitol\r\n- Chutney\r\n- Gelatin\r\n- Panko\r\n- Masa\r\n\r\n-Comes with instructions and tips to install your graphic or lettering.\r\n-Includes a sample vinyl to test.\r\n-vinyl can be used inside or outside. \r\n--New to vinyl decals and lettering? add our vinyl application pack to your order and make applying any graphic easier and faster. view here https://www.etsy.com/listing/206257848/vinyl-application-install-kit-for-decals?\r\n\r\n[][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][]\r\n\r\n-----{ COLORS }----- \r\n\r\n-Over 70+ colors to pick from! We also have premium metallic’s  for a bit extra. \r\n(Indoors will virtually last forever! Neutrals are rated at 6yrs outdoor, Colors and Matte 4yrs outdoor.)\r\n\r\n-Default color is black. If no color is selected black is what will be sent.\r\n-Colors are approximate and may vary from your screen.\r\n\r\n\r\n[][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][]\r\n\r\n-----{ CUSTOMIZE }-----\r\n\r\n-Want it smaller or larger?\r\n- Want a special look like a specialty vinyl (premium metallic, fluorescent, transparent, textured, glow in the dark…ect) \r\n-want it in a different design, style or layout?\r\nREQUEST A CUSTOM ORDER TO GET STARTED!\r\n\r\n\r\n\r\n[][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][]\r\n\r\n\r\n-----{ ABOUT OUR WALL DECALS }-----\r\n\r\n-Our wall decals are made from a high quality vinyl made for indoor and outdoor use. Our decals are completely die cut, there is no clear background. Vinyl decals can stick to almost any smooth surface including walls, windows, glass, laptops, ceramics, flooring, and more! Decals will work on most lightly textured surfaces. Vinyl wall decals are removable, but are not reusable. \r\n\r\n-All graphics are laminated / masked in a special paper masking tape.\r\n**Vinyl is ready to be installed.\r\n*Please check the listing information for sizing. Not all pictures show decals to scale.\r\n\r\n\r\n[][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][]\r\n\r\n \r\n----{  PURCHASING }----\r\n\r\n-You’re order ships in 1-2 business days from received payment!\r\n-We offer a standard warrantee and satisfaction guarantee. Check our shop policy.\r\n*Orders placed out of the United States with multiple varations like size, often calculate shipping and postage rates incorrectly. On average we need to collect $4-$10 additional on top of whats already paid. This isn&#39;t always the case but most of the time. We do apologize for this but it is an Etsy issue and out of our hands. \r\n\r\n[][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][][]\r\n\r\n \r\n----{  DISCOUNTS }----\r\n\r\n-We offer 25%-50% for bulk and larger orders. Contact us for a quote.\r\n-Like us on Facebook and use discount code “friends” for 10% off your order.\r\nGO TO&gt;&gt; http://www.facebook.com/vinylisyourfriend TO LIKE US \r\n-For other discounts view our shop home for any discounts or specials.\r\n\r\n\r\nThanks!\r\n\r\nWe are a company out of Utah and we appreciate your support whether an American or Utahn!\r\n\r\n\r\nTools you may want to help with install:\r\n•\tSqueegee(not included)\r\n•\tMasking tape for temporary hinges to help lay down the graphic.(not included)\r\n•\tsurface or wall cleaner to wash application area for maximum adhesion.  (not included)\r\n\r\n© Creative8 Imaging, 2013.",
