"announcement": "Vinyl is your friend is a 5 star vinyl decal shop in Utah with over 15 years graphics experience! We use top materials  and equipment used by professionals around the world! We have one of the largest selections of vinyls out there in over 70+ colors and dozens of specialty vinyls, you&#39;re going to get what you want! We respond fast and ship your order in 1-2 business days. We are constantly creating new graphics to bring great vinyl decor ideas to your walls! Every order comes with our satisfaction guarantee and is automatically insured up to 50% of the purchase price. For more info our our guarantee see out shop policies.\r\n\r\nLike us on Facebook and use coupon code &quot;friend&quot; for 10% off all orders of $10 or more!\r\n\r\n\r\n",
