"sale_message": "Get a $10 off coupon! Follow the link and answer a few short questions to help us do better! Do this after you receive your order! Thank you so much!\r\n\r\nhtttp://www.feedback.vinylisyourfriend.com\r\n\r\n\r\nDo you have a blog? Share your vinyl project on your blog and we&#39;ll give you 25%-50% off your order! Message us for the details and how to qualify! \r\n\r\nCHECK YOUR ORDER for a discount coupon and a special message from us here at Vinyl is your Friend!\r\n\r\n\r\nThank you for your order, friend!\r\n",
