"policy_welcome": "Welcome to Vinyl is your friend! If you didn&#39;t know, Vinyl is your friend! It goes on almost anything! YEEHAW! We LOVE making vinyl graphics. It&#39;s our favorite. How can you make your home more pleasant and beautiful? VINYL! We also have the ability to print on vinyl so get creative!",
"policy_payment": "TERMS:\r\nall Items are made to order! Allow 1-2 BUSINESS DAYS for production after payment clears. Thank you! You can pay within 3 days of purchase. if unpaid after 72 hours we may cancel the order. We accept credit cards and Paypal and Etsy gift cards.\r\n\r\nCANCELLATION:\r\nItems paid for can only be cancelled before 10:30am the following day of the order if made after 3 pm. Orders placed between 10:30am and 3pm have a 30 min cancellation time. 10:30am-3pm is when we produce orders. If cancelled between this time a refund may or may not be given.\r\n\r\nTAXES:\r\nWe charge taxes according to state and federal law.\r\n",
"policy_shipping": "ADDRESSES:\r\nPLEASE MAKE SURE THE ADDRESS YOU CHECK OUT WITH IS THE ADDRESS YOU WANT SHIPPED TO.  Address changes on orders once placed must be cancelled and ordered with the correct address. We are sorry for this inconvenience but we&#39;ve tried changing addresses and it&#39;s too easy to forget to change the address and ship to the address on file when we process orders THIS IS FOR YOUR BEST. WE WILL NOT CHANGE SHIPPING ADDRESS ONCE ORDER IS PLACED. \r\n\r\nSHIPPING METHODS:\r\nWe ship all items through USPS. We are currently shipping to America and Canada and Australia. All items 15 oz. and above are 95% of the time shipped Priority Mail which is rated at 2-3 business days. All items 15 oz. and below are shipped via USPS First-Class mail which is rated at 2-5 days. If you need something faster please contact us to arrange payment and shipping. WE DO NOT GUARANTEE DELIVERY DATES. If you want a guaranteed delivery date please contact us for a price quote. \r\n\r\nINSURANCE:\r\n\r\nIf shipped via USPS Priority you item comes with a standard $100 insurance offered by USPS and is applicable to their policies. For additional insurance please ask us to add or quote it out for your order. most items are shipped via USPS First-Class mail and do not come with insurance.\r\n\r\nUPGRADES:\r\nWe are happy yo upgrade your shipping to an overnight or 2 day option. Please ask us about it.\r\n",
"policy_refunds": "First please contact us through the message system on the account the item was purchased and we will do our best to respond as quickly as possible.\r\n\r\nPlease provide the following information when contacting us about Return/Exchanges:\r\n- date of purchase\r\n- your etsy screen name (if different from the account you are contacting us through)\r\n- paypal email address\r\n\r\nRETURNS and REFUNDS on ERRORS\r\n\r\nRETURNS and REFUNDS will be given on, products that are the wrong color, size, or otherwise not what was ordered and is limited to 15 days after delivery. Full purchase price will be given to orders that meet the criteria for a full refund. The item must not have been used and be packaged for safe return shipping (if it comes back damaged in any way or we are not able to resell it, no refund will be given). We include with every order a test decal and insist you test the surface before applying a graphic. This is because there are hundreds of surface types decals can be applied to, not all of them are vinyl friendly and we can&#39;t monitor this. It also helps to familiarize yourself with the decal to see how it will work. A majority of the problems that occur with installing are because of installer error.\r\n\r\nCUSTOM ORDERS\r\n\r\nReturns and refunds on custom orders will not be given unless item is damaged or was not what was ordered. This includes regular orders with custom names. Please ensure your proof has the correct spelling and layout before placing order. We do this because custom orders take considerable time to make. Please ensure that you know what you want and how to apply graphic before purchase. If an error with your order does occur and we are at fault we will do our best to correct this. ALL CUSTOM ORDERS WITH AN ERROR MUST BE GIVEN AN OPPORTUNITY TO BE CORRECT BEFORE ANY RETURN OR REFUND WILL BE GIVEN.\r\n\r\n\r\nDAMAGES AND DEFECTS (please purchase insurance)\r\n\r\nWe ask customers to purchase insurance on their orders and immediately inspect the items delivered. If any damages or defects were found, Vinylisyour friend will replace or repair item(s) without insurance up to 50% of the purchase price at a max of $50. For Items with insurance, replacements will be made up to the insured amount and will qualify based up the insurance policy purchased. Any damaged items must be given an opportunity to be replaced. \r\n*The damage or defect claim must be made within 3 business days of delivery. \r\n\r\n\r\nLOST ITEMS (please purchase insurance)\r\n\r\nItems lost in the mail will be replaced up to $50% of the purchase price and no more then $50. For full coverage please purchase shipping insurance. Any item lost must be given an opportunity to be replaced. Please allow us the opportunity to replace your item. Orders without shipping insurance will need to be purchased at a pro-rated amount of , Original purchase price minus 50% of original purchased price up to $50, else we cannot send a replacement graphic. The original purchase price is the price minus any discounts or promotions.",
"policy_additional": "COPYRIGHTS. \r\n© creative8 Imaging, 2013.\r\nAll graphics included but not limited to display pictures, product photos, photographs, graphics, and designs are copyrighted by CREATIVE8 IMAGING the company that owns &quot;Vinyl is your Friend&quot; or &quot;VINYL FRIEND&quot; a DBA. Most of the work in our shop is designed and created by us. We have some licensed work in our shop and use from time to time other graphics and designs with appropriate permissions. If there is mistake or an error in judgement and a design or graphic is has not been granted use or licensed please contact us to resolve. We do our best to ensure we are using properly licensed designs and graphics when applicable. \r\n\r\nCUSTOM DESIGNS\r\n\r\nOrders with custom designs where Vinyl is your friend is creating the graphics or providing graphics to customers remain the copyright of CREATIVE8 IMAGING. We do not license or grant use of our work for resell or redistribution unless expressly written. We also reserve the right to resell and use custom designs and graphics in our shop. \r\n\r\nSATISFACTION GUARANTEE:\r\n\r\nWe are positive you&#39;ll like your order with us. If our product didn&#39;t meet your expectations we&#39;ll gladly give a FULL REFUND within 5 days of delivery. Please give us the chance to correct it if there are issues. If then, we are unable to make it better, we&#39;ll gladly refund you your money. If that happens for whatever reason, we ask you return the order or item to us. We will send a shipping label at no cost to you to send it back. Once we receive the item and inspect it, we&#39;ll issue your refund. Refund is conditional upon the condition of the returned item but is not definite. The item must not have been used and be packaged for safe return shipping(if it comes back damaged in any way, or is unusable, no refund will be given). Refunds on Custom Orders are excluded.\r\n\r\n\r\nWe do custom orders. If there is a size you would like just shoot us a message! Just so you know not all the colors displayed here are exact. Your screen shows colors differently then ours.\r\n\r\nWe offer wholesale pricing and offer consignment opportunities to designers. Contact us for more details. ",
