"title": "Vintage Style Cookbook / Wooden Fork &Spoon / Apron Decorations",
"description": "This 9in. x 12in. , 56 page cookbook was designed and crafted in my home studio. It has 5 rings binding the decorated chipboard cover and inside 8 1/2in. x 11in. pages. Making it easy to add more pages if wanted. Vintage colors on cover with apron and rolling pin.  Wooden fork and spoon hang from antique silver chain and green crystal bead. The outside corners have metal covers to protect edge.\n\nI divided the cookbook with tabs covered with clear vinyl :\nAppetizers\nSalads\nSoups\nVeggies\nMeat\nBreads\nDesserts\n\nFive of the tabbed pages has pockets for loose papers. Each section has 7 double sided paper, lined on one side.\n\nThe book is decorated vintage style with pictures, canned labels, old utensils and recipes and buttons.\n\nThe front inside cover has a handy conversion table and you will also find a table on how to cut a recipe in half inside your cookbook.\n\nThis is a perfect shower gift for the new bride along with one of your own recipes or any gift giving occasion.\n\nThis cookbook ships FREE in the U.S.\n\nFeel free to contact me with any questions.",
