"description": "HAND MADE IN THE USA By Creative Butterfly XOX \n\nA Stylish yet functional BAMBOO cutting board, with a manly design of &quot;The GrillFather&quot; and hand  image with grilling tool.\n\nMAKES A GREAT GIFT FOR FATHERS DAY\n\nOr gift to dad on his birthday, for any holiday celebration or just because.\n\n♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥♥ ♥ ♥ \nThis board comes as shown ONLY and does NOT come with any additional personalization.  If you wish to add additional personalization, such as a date or name, please convo me PRIOR to purchase with your wishes as this will be an ADDITIONAL CHARGE.  Please do not purchase from this listing, as this listing comes as shown in the listing pic examples ONLY.  Thank you.\n♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥♥ ♥ ♥ ♥♥ ♥ ♥ \n\nThis cutting board comes in BAMBOO, which has a natural to medium color tone as shown in the listing pics. \n\nBoard measures approx 14 X 7.5.\n\nThis makes a great wedding gift or anniversary gift. Also makes a great gift for any newly wed couple. \n\nThe board is coated in a protective food safe coating of butcher block oil, this provides a rich and lustrous sheen while actually protecting the wooden board surface. \n\nThe board has 2 sides, you can use the engraved side as beautiful decor in your home or kitchen, and you can use the plain (non engraved side) to prep your food.\n\nMAKES A GREAT GIFT.\n\nThe design comes as shown in the listing pic examples \n\n\n****  THIS BOARD COMES AS SHOWN IN THE LISTING PIC EXAMPLES ONLY AND DOES NOT COME WITH ANY ADDITIONAL PERSONALIZATION. ****\n\n\n♥ ♥ ♥ About BAMBOO: ♥ ♥ ♥ Bamboo is a renewable resource. Bamboo is the fastest growing woody plant in the world. This astounding growth is because bamboo is a grass - not a tree. When harvested, up to 1/3 of the bamboo will fully grow back within one year. This makes bamboo an excellent alternative to hardwoods, and extremely ECO FRIENDLY.\n\n\n♥ ♥ ♥ TO CARE FOR THE BOARD ♥ ♥ ♥ \n♥ Periodically and/or as needed, apply mineral oil or butches block oil to the board, to help to keep it looking it&#39;s best.\n♥ Wash with soap and warm water. Do NOT place in the dishwasher.\n\n\n**** This is a made to order item - please allow approx 6 to 10 business days to create + shipping time to your location *****\n\n** Please hand wash only ***\n\n\n♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥♥ ♥ ♥ \n\n** Please note - If this is a time sensitive order and you need it for a special date, please make sure to order ahead of time and allow for shipment time to your location.**\n\n\n♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥♥ ♥ ♥ \n\n***For international orders please see shipping policies section for full details regarding international shipping, and allow extra time for delivery before your wedding date.****\n\n♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥ ♥\n\nLike what you see? Find the rest of my shop items here: http://www.creativebutterflyxox.etsy.com\n\nFind out about shipping policies here: http://www.etsy.com/shop/CreativeButterflyXOX/policy\n\n---------------------------------------------------\nCopyright © 2009 - 2014 CreativeButterflyXOX",
