"announcement": "We sell original rubber stamp designs, supplies and handstamped jewelry!\r\nEverything in our shop is ready to ship! \r\nFind us on instagram: Instagram.com/wyorkartstudio and pinterest: pinterest.com/wyorkartstudio\r\n\r\nAll my life I have enjoyed creating art. I think that is why I love rubber stamps so much. They can be used to make cards, journaling (my favorite right now), scrapbooking, jewelry and more. All the stamps in our shop are original artwork. I owned and operated The Stamp Clinic for more than 8 years. I hired the artists and made the stamps. These are some of those wonderful designs. Enjoy!\r\n\r\n*NOTE - PLEASE READ our description for the actual size of our stamps! \r\n\r\nIf for any reason you are not happy with your purchase please contact me before leaving a review so that I have a chance to make it right. I want you to be totally happy with your purchase enough to return in the future. \r\n\r\nThanks for checking out my shop.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Welcome\r\nThank you for your interest in my etsy shop. I have always been a person who felt a strong need to create. My hope is that you will totally enjoy your purchase. \r\n\r\nAngel Policy\r\nWe are an angel company as long as the items you make with our rubberstamps are handmade. Electronically reproduction is not allowed. All rubberstamps in our shop are copyrighted.\r\n\r\nPayment\r\nWe expect your payment within 2 days of placing your order. If for some reason you need to extend the time please email us to see if we can work something out. We accept paypal for all sales in our shop.\r\n\r\nShipping\r\nYour order will be ship within 3-4 days of your order being placed.  All other orders will be shipped through the US postal service. If you want to pay extra for confirmation please let us know. \r\n\r\nRefunds and Exchanges\r\nWe will gladly grant refunds on items if the reason for return product defect.  Please email before you ship any return items to be sure that you are eligible for return. \r\n\r\nTaxes\r\nFor all our IL residents please understand that I have to charge 9.25% sales taxes for any purchase made from my shop. \r\n\r\n**INTERNATIONAL BUYERS PLEASE READ**\r\n\r\nInternational orders typically take 1-2 weeks for delivery, but can take up to 4-6 weeks (occasionally they become delayed by customs), so please order accordingly.\r\n\r\nThe price of our products does not include any duties or VAT. Our shop only charges you goods cost and shipping cost. if you are charged of a VAT, you need to pay it to your customs.\r\n\r\nIn most countries, you have to pay taxes or duties on imported goods. Sometimes goods under a certain value, or in certain categories, do not incur taxes. \r\n\r\nThe rules are different in every country. Unfortunately there is no way for us to know the rules, regulations, customs, or rulings of every single country. \r\n",
"digital_sale_message": null,
"last_updated_tsz": 1431457926,
