"login_name": "YorksLittleArtStudio",
"accepts_custom_requests": false,
"policy_welcome": "Welcome\r\nThank you for your interest in my etsy shop. I have loved rubberstamps and creating things for most of my life. My hope is that you will totally enjoy your purchase. \r\n\r\nAngel Policy\r\nWe are an angel company as long as the items you make are handmade. You cannot claim the image as your own. Electronically reproduction is not allowed. All rubberstamps in our shop are copyrighted. Please respect the copyright. These images cannot be mass produced or digitally copied or printed. The images may not be resold or redistributed in any form.",
"policy_payment": "We expect your payment within 2 days of placing your order. We accept paypal for all orders in our shop. If for some reason you need to extend the time please email us to see if we can work something out.\r\n\r\nTaxes\r\nFor all our IL residents please understand that I have to charge 9.25% sales taxes for any purchase made from my shop. \r\n",
"policy_shipping": "Your order will be ship within 3 days of your order being placed. Please keep in mind that international orders will take time to arrive due to customs. Any customs charges will be the responsibility of the customer.  All orders will be shipped through the US postal service. If you want to pay extra for confirmation please let us know. ",
