"shop_name": "StrictlyVintage",
"user_id": 10404192,
"creation_tsz": 1278443868,
"title": "Strictly Vintage",
"announcement": "Welcome to my shop Strictly Vintage. I travel to Estate Sales, Auctions, Flea Markets, and comb Thrift Shops to bring you treasures and oddities that you didn&#39;t know you couldn&#39;t live without. I have always loved old vintage and antique things. They bring charm and warmth to any home and often ignite a special memory and conversation, as well as reflect each owner&#39;s unique personality!  \r\n\r\nStrictly Vintage is a proud member of the Esty Vintage Society Street Team & Etsy Wine Time Team.\r\n\r\nIf you have any questions please let us know! \r\n\r\nYou can now follow us on Facebook now!  Check it out and click &quot;like&quot; so you can be informed on upcoming sales and promo&#39;s! \r\nhttp://www.facebook.com/pages/New-York-NY/Strictly-Vintage/142583669124563?v=wall",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you so much for visiting Strictly Vintage! We hope you enjoy your purchase.  Please visit back often as new merchandise is always being added!",
"digital_sale_message": null,
"last_updated_tsz": 1432486109,
"listing_active_count": 122,
"login_name": "StrictlyVintage",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to my shop Strictly Vintage. I travel to Estate Sales, Auctions, Flea Markets, and comb Thrift Shops to bring you treasures and oddities that you didn&#39;t know you couldn&#39;t live without. I have always loved old vintage and antique things. They bring charm and warmth to any home and often ignite a special memory and conversation, as well as reflect each owner&#39;s unique personality.",
"policy_payment": "PAYMENT must be received before items are shipped, or delivered.\r\n\r\nPAYMENT OPTIONS\r\n- Paypal\r\n- Direct Checkout with your Credit/Debit Card\r\n\r\nDISCOUNTS / PRICE REDUCTIONS\r\n\r\nStrictly Vintage is committed to offering the best prices possible. Please understand prices are set after much care, and consideration. Often pieces require work to obtain, list, repair etc. The prices are not arbitrary. Should you see the same item for a lower price, snap it up!\r\n\r\nSMALL Discounts will only BE APPLIED for multiple item purchases.\r\nIf you are committed to buying multiple items you may contact Strictly Vintage prior to purchase and request a MULTIPLE item. \r\n\r\n+++Please be respectful that discounts are a privilege given after much consideration by Strictly Vintage. Don&#39;t ask unless you are ready to purchase. Once a discount is offered you have 24 hours to honor the discount otherwise the discount is null and void.\r\n\r\nRESERVES / HOLDS\r\nWe are happy to reserve items if you are **positively** going to purchase, but potentially need some additional time to coordinate shipping options/ quotes, or make funds available.\r\n\r\nWe do NOT place Holds or Reserves to give buyers time to make final decisions. Please contact us with whatever issues you have, we&#39;re happy to try to help work them out.\r\n\r\nCanceling Orders / REFUNDS\r\nWe do not CANCEL orders. If there is an extreme circumstance we are happy to try to work with you. Store credit may be issued, restocking fees may also apply.\r\nPLEASE read all descriptions and ask questions before purchase!!!",
"policy_shipping": "ShippingAll orders will be shipped out to Etsy/Paypal addresses, so please make sure that your address is up to date before checking out.\r\n\r\nUsually, orders will be processed and shipped out within 3 business days after the Paypal payment has cleared with the exception of holidays/weekends.\r\n\r\nDepending on the size, weight, and destination, your package may be sent by USPS, UPS or Fed Ex. \r\n\r\n\r\nDAMAGED or LOST items due to Shipping:\r\n\r\nOnce an item leaves my hands into the shippers it is technically no longer my responsibility. While I try to do my very best to package things so they are not broken in transit, on occasion, items do get damaged and/or lost. .\r\nI am happy to help with the filing of your insurance claim but you must provide me with photos of broken items and packaging.  If you wish to purchase insurance on a package is desired, please convo us BEFORE checking out so that your total shipping charges can be adjusted.\r\nPleas keep all packaging until the claim is filed. I do not pay for return shipping on damaged items.\r\n\r\n\r\n\r\n\r\n\r\n\r\n",
"policy_refunds": "Due to the vintage nature of the items on this site, all sales are final. Please make sure that you love the item before purchase. We do our best to describe all items accurately, but we are certainly not experts in all things vintage. Feel free to contact us with any questions you may have prior to your purchase. Thank you!",
"policy_additional": "We only ship within the intercontinental United States. For shipping to Alaska or Hawaii please contact us for shipping costs. \r\n.",
