"shop_name": "LeBonheurDuJour",
"user_id": 29195243,
"creation_tsz": 1358804636,
"title": "Antique French Decor and Collectibles.",
"announcement": "Le Bonheur du Jour offers a selection of fine vintage and antique French collectibles. The assortment includes vintage French country home furnishings, lovely old table linens as well as Art Nouveau and Art Deco pieces.\r\n\r\nIf you are looking for a specific piece to compliment your French country home deco or even a special French gift or souvenir please send me a message and I will happily try to source on your behalf.\r\n\r\nPlease visit my Etsy shops:\r\nhttp://www.etsy.com/shop/LeBonheurDuJour\r\nhttps://www.etsy.com/shop/CoffeeandNostalgia\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order!\r\n\r\n I know there are many wonderful choices on ETSY and I appreciate that you have selected Le Bonheur du Jour. I hope your new piece will bring you great pleasure.\r\n\r\nYour item(s) will be shipped from France within 1-3 business days.  The parcel will be sent by priority airmail which includes tracking and insurance. Once it has been posted you will receive an email from me with the tracking number and expected delivery time. You will then be able to keep an eye on it during it&#39;s journey to you.\r\n\r\nOnce you have received your package and are happy with your purchase please feel free to leave a  review of your shopping experience with me, positive feedback is very important to us sellers on ETSY for future sales.\r\n\r\nI strive for 100% customer satisfaction and if for any reason you are unhappy or dissatisfied with your  order, please contact me immediately so that I can resolve the situation in the best way possible.\r\n\r\nMany thanks once again and kind regards,\r\n\r\nFabien\r\n\r\n\r\nTracking an Order:\r\nwww.etsy.com/help/article/2775\r\n\r\nAbout The Review System\r\nhttps://www.etsy.com/help/article/102\r\n\r\nLe Bonheur du Jour&#39;s Shop Policies:\r\nhttps://www.etsy.com/shop/LeBonheurDuJour/policy?ref=shopinfo_policies_leftnav",
"digital_sale_message": null,
"last_updated_tsz": 1432591048,
"listing_active_count": 628,
"login_name": "fabieninvernizzi",
"accepts_custom_requests": true,
"policy_welcome": "Thank you for visiting Le Bonheur du Jour.  Here you will find a selection of fine vintage and antique French collectibles.  I hope you find a little something to brighten your day.\r\n\r\nIf you are looking for a specific piece to compliment your French country home deco or even a special French gift or souvenir please send me a message and I will happily try to source on your behalf.\r\n\r\nPlease visit my Etsy shops:\r\nhttp://www.etsy.com/shop/LeBonheurDuJour\r\nhttps://www.etsy.com/shop/CoffeeandNostalgia\r\n",
"policy_payment": "We accept payment via PAYPAL, Direct Checkout and Etsy Gift Cards.\r\n\r\nLay-Bye options are available. Please contact me with your needs and we&#39;ll come up with the most suitable plan for you.",
"policy_shipping": "MULTIPLE ORDERS\r\nIf you purchase one or several items of my shop at the same time, I would suggest  you send me an Email to request the recalculated shipping fees and we will prepare for you a reserved listing with your revised shipping fee.\r\n\r\nSHIPPING AND DELIVERY TIME\r\nAll orders are sent worldwide by French registered airmail within 1 - 3 working days of receipt of payment.\r\n\r\nAll orders will be shipped with a tracking number. In most cases, orders will be posted with registered airmail which means the package will have to be signed for. To avoid inconvenience please track the parcel&#39;s progress to ensure you will be available to sign for it.\r\n\r\nDelivery times vary, but are generally around 10 to 14 business days for international orders. If your package takes longer to arrive, please be patient as delivery can occasionally take a little longer, especially during the holidays.\r\n\r\nPACKAGING\r\nI want you to receive your order in great condition so every care will be taken when packing. \r\n\r\nSHIPPING ADDRESS\r\nI will always ship to your Etsy address as provided with your order. Please double-check that all your details are correct at check out.  If you would like your order to be shipped to a different address instead, please provide the correct address when placing your order. \r\n\r\nCUSTOMS FEES, DUTIES ETC\r\nCustomers outside of France are responsible for any fees, taxes and duties associated with importing into their respective countries. Please note, international import duties, taxes and tariffs are not included in the shipping quote and are the buyer&#39;s sole responsibility. Please be aware of your country&#39;s regulations before you order. ",
"policy_refunds": "Please contact me here on Etsy if you are not satisfied with your purchase. I want you to be happy with your purchase so I would love to work with you to see how we can make sure your experience with Le Bonheur Du Jour is a positive one.\r\n\r\nWe do our best to describe all items accurately, but on a rare occassion we might just be wrong, or miss something. Feel free to contact us with any questions or issues you may have and we will do our best to help.",
"policy_additional": "We sell vintage or antique items that we feel merit a new lease in life. This means that most or all of our items are used and have been handled and show some signs of wear or age. We will disclose all major defects such as cracks, chips, hairlines, tears, plate loss, paint loss, discolorations, missing parts, etc, or any irregularities that we see. Please check carefully the descriptions and photos. If you have any questions or concerns about an item, please contact us before you purchase.\r\n\r\n",
"policy_seller_info": "Le Bonheur du Jour\r\nL&#39;Isle sur La Sorgue\r\nFrance",
