"description": "Welcome to the original lard producer on Etsy, LardLad.  The purest lard available filtered to 1 micron.\n\nWhat the heck is a micron?  A micron is a unit of measure. 1 micron is 0.001 millimeter.  In more palpable terms: a human hair is ~70 micron and smoke from my over cooked roast is 0.5 micron.  1 micron goes above and beyond the need to filter out all but the pure, beautiful fat.  \nThis means no more yellow haze on the bottom of your bag or jar.  No more off white look.  And maybe most off all no more food for bacteria to eat and grow in.\n\nThis listing is for my basic or commercial grade lard.  See other listing for organic. \n\nPackaged in 2mil bags and heat sealed immediately after filtering.  This ensures limited exposure to the air, preventing bacterial contamination and oxidation.  Sealed bags are then cooled to below 40 degrees within 60 minutes.\n\nPacked shipped as 2, 1/2 gallon bricks.\n\nProducts backed 100% satisfaction.\n\nHaving a lifetime of food service experience and a strong science eduction, my goal is to provide the purest lard available.  That has been achieved with an ever evolving process.\n\n\nCheers!\nDouglas",
